import { Landmark } from "../models/Landmark";
import { User } from "../models/User";

const apiBaseUri = "http://192.168.0.150:11116/api/"
const getLandmarksUri = apiBaseUri + "landmarks"

export function getLandmarks(): Landmark[] {
  var landmarks: Landmark[] = []

  console.log('Retrieving Landmarks from ' + getLandmarksUri)
  fetch(getLandmarksUri)
    .then((response) => {
        console.log(response.text)
    })
    /*.then((responseJson) => {
      console.log('Landmarks retrieved')
      //landmarks = responseJson
    })*/
  .catch(error => console.log('Error: ' + error))

  return landmarks
}
